import React from 'react'
import background from '../Assets/bgbg.png'
import '../Stylesheets/Home.css'

function Home() {
  return (
    <div>
      <Search />
    </div>
  )
}

export default Home

function Search() {
  return(
    <div className='home'>
      <div className=' pl-[7%] pt-[2%] flex max-w-[100vw]'>
        <h1 className='text-white font-bold text-[50px] leading-[110px] w-[40%] pt-[5%] text-center'>LETS FIND THE PERFECT HOUSE FOR YOU</h1>
        <img className='w-[60%]' src={ background } alt=' a building' />
      </div>
    </div>
  )
}
